(143, 196, 'SmartSoft_Feed', 'Accounting Stock Module', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 8pt; color: rgb(34, 34, 34); letter-spacing: normal; line-height: 15.6933px; font-size: 11pt; font-family: Calibri, sans-serif;\">Dear Sir</p><p class=\"MsoNormal\" style=\"margin: 0in 0in 8pt; color: rgb(34, 34, 34); letter-spacing: normal; line-height: 15.6933px; font-size: 11pt; font-family: Calibri, sans-serif;\">Dhaka Feed mill sent silo Feed 524F(Silo) on 8 juneâ€™2019 but when truck unload at farm that time farm found&nbsp;<span class=\"il\">90</span>&nbsp;<span class=\"il\">kg</span>&nbsp;feed shortages. For that reason transporter paid demurrage of&nbsp;<span class=\"il\">90</span>&nbsp;<span class=\"il\">kg</span>. then we adjust weight &amp; customer&nbsp;<span class=\"il\">balance</span>&nbsp;by opening 1 invoice.&nbsp;&nbsp;</p><p class=\"MsoNormal\" style=\"margin: 0in 0in 8pt; color: rgb(34, 34, 34); letter-spacing: normal; line-height: 15.6933px; font-size: 11pt; font-family: Calibri, sans-serif;\"><b>Now&nbsp;<span class=\"il\">R120</span>&nbsp;<span class=\"il\">report</span>&nbsp;<span class=\"il\">showing</span>&nbsp;<span class=\"il\">90</span>&nbsp;<span class=\"il\">kg</span>&nbsp;<span class=\"il\">CF</span>&nbsp;<span class=\"il\">balance</span>. But silo feed not show any&nbsp;<span class=\"il\">balance</span>.&nbsp;&nbsp;</b></p>', 'Closed', 'public/images/application/5d300873e36792019-07-18-11-49-39Stock_Report(120).pdf', 'public/images/application/5d300873e39442019-07-18-11-49-39CCI_001097.pdf', 'public/images/application/5d300873e3b5d2019-07-18-11-49-39Untitled.jpg', NULL, 1, '2019-07-18 05:49:39', '2019-07-18 05:49:39'),
