(148, 211, 'SmartSoft', 'Receipt Module', '<p>I want to pay in and link to North bengal breeder (GL-23) to IBBL 2049 Chuadanga Feed Mill (150ZZ01212) but there show \"no text file to print\"</p>', 'Closed', 'public/images/application/5d3c1a17407cc2019-07-27-15-32-07Scan0006.JPG', NULL, NULL, NULL, 1, '2019-07-27 09:32:07', '2019-07-27 09:32:07'),
(149, 269, 'Win Food', 'Sale Management', '<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:13.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">Dear Sir,</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">We would like to inform that\r\nYesterday mistakenly input feed production in Finish Goods win feed software on\r\ndate 26 july instead of 27 july. After input production we change date. Now we\r\nneed to cancel that production from Finish Goods win feed software. For this we\r\nneed to open previous date (26 July).&nbsp;</span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">So, it is requested to IT department\r\nto open previous date&nbsp;<span style=\"color:red;background:#F3F3F3\">(26 July)</span>&nbsp;in\r\nFinish Goods Win Feed System.</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\"></span></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:14.0pt;line-height:107%\">My user ID is : mohammed.zah</span></b></p>\r\n\r\n', 'Closed', NULL, NULL, NULL, NULL, 1, '2019-07-28 04:04:25', '2019-07-28 04:04:25'),
(150, 211, 'SmartSoft', 'Receipt Module', '<p class=\"MsoNormal\">I want to pay in and link to North bengal breeder (GL-23) to\r\nIBBL 2049 Chuadanga Feed Mill (150ZZ01212) but there show \"no text file to\r\nprint\"</p><p class=\"MsoNormal\">Bank Route Code- <b><span style=\"font-size: 18px;\">2123C02049</span></b></p>', 'Closed', 'public/images/application/5d3d1fbeb1d112019-07-28-10-08-30Pay_in_Problem.PNG', NULL, NULL, NULL, 1, '2019-07-28 04:08:30', '2019-07-28 04:08:30'),
(151, 306, 'SmartSoft_Feed', 'Finish goods Inventory Management Module', '<div style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 13pt; letter-spacing: 0.8px;\">&nbsp;</span><span style=\"font-family: Arial, sans-serif; font-size: 13pt; letter-spacing: 0.8px;\">Dear Sir,</span></div>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:&quot;Angsana New&quot;\">We would like to inform that Yesterday\r\nmistakenly input feed production in Finish Goods win feed software on date 26\r\njuly instead of 27 july. After input production we change date. Now we need to\r\ncancel that production from Finish Goods win feed software. For this we need to\r\nopen previous date (26 July).<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\n&quot;Angsana New&quot;\">So, it is requested to IT department to open previous date in\r\nFinish Goods Win Feed System.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\n&quot;Angsana New&quot;\">My user ID is: - mohammed.zah<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:14.0pt;color:blue\"><o:p>&nbsp;</o:p></span></p>', 'Closed', NULL, NULL, NULL, NULL, 1, '2019-07-28 04:55:02', '2019-07-28 04:55:02'),
