(158, 309, 'SmartSoft_Feed', 'Raw Material Inventory Management Module', '<p>Dear Sir,</p><p><span style=\"color: rgb(156, 0, 255); background-color: rgb(255, 255, 255); font-weight: bold;\">I would like to informed you that,dated on 04/07/2019, we are received (16 bags 400 kgs) Eskavit CP vit.Premix-582Beef(25 Kg).But it is show in location medicine &amp; chemical Product type (06).when we use that time show product type mismatch.</span></p><p><span style=\"color: rgb(156, 0, 255); background-color: rgb(255, 255, 255); font-weight: bold;\">Need to show in location premix &amp; additive product type (04).</span></p><p><span style=\"color: rgb(156, 0, 255); background-color: rgb(255, 255, 255); font-weight: bold;\">so need to necessary steps for better stock maintain.</span></p>', 'Closed', 'public/images/application/5d428d78cec412019-08-01-12-58-00PMX-582....png', 'public/images/application/5d428d78cede52019-08-01-12-58-00PMX-582..png', 'public/images/application/5d428d78cef292019-08-01-12-58-00PMX-582.png', NULL, 1, '2019-08-01 06:58:00', '2019-08-01 06:58:00'),
