(160, 190, 'SmartSoft_Feed', 'NCR-CAR Online Module', '<p>When try to send email via winfeed (NCR-CAR online module) system an error massage displayed and email not send. This problem is happen only for birgonj feed mill. As well as when F.T.O AGM Mr. AKM Sultan Shahriar is trying to send email to birgonj feed mill by using winfeed (NCR-CAR online module) system email not sent.</p><p>I am sending you list of all responsible persons of birgonj feed mill how have faced same problem in attachment. <br><p><br></p></p>', 'Closed', 'public/images/application/5d4657b5632f52019-08-04-09-57-41NCR_BIR.docx', 'public/images/application/5d4657b56358c2019-08-04-09-57-41Information_of_BRM_staff.xlsx', NULL, NULL, 1, '2019-08-04 03:57:41', '2019-08-04 03:57:41'),
