(165, 306, 'SmartSoft_Feed', 'Weight Module', '<p><span style=\"font-family: Arial, sans-serif; font-size: 12pt; letter-spacing: 0.8px;\">Dear Sir,</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;\">Today Scale Dept. of Birganj FM take 1<sup>st</sup> scale one Corn\r\nTransfer Truck. Truck ID is DM.T 13-2605 &amp; Queue number is <b><span style=\"color:red\">4102019002997</span></b>.\r\nBut when he check 1<sup>st</sup> weight in his win feed software. He cannot\r\nfind it. But IT dept. find 1<sup>st</sup> weight in their system. Now we need\r\nto cancel 1<sup>st</sup> weight from win feed sftware.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;letter-spacing:.6pt\">So,\r\nit is requested to IT department to cancel 1<sup>st</sup> weight of that truck\r\nfrom scale dept win feed software.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;letter-spacing:.6pt\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;letter-spacing:.6pt\">Scale\r\ndept. win feed software id is: - weight.birganj<o:p></o:p></span></p>', 'Closed', NULL, NULL, NULL, NULL, 1, '2019-08-08 09:53:56', '2019-08-08 09:53:56'),
(166, 283, 'SmartSoft_Farm (Poultry)', 'Stock System', '<p>In Org Code \"20000\" <b>Center-Chittagong Broiler </b>need to add <b>\"Document Type- 84\"</b> in <b>\"Move-Out Medicine to Sale Center\"</b></p>', 'Closed', 'public/images/application/5d4bfcce41ba92019-08-08-16-43-26Center_Chittagong_Broiler.jpg', 'public/images/application/5d4bfcce41ead2019-08-08-16-43-26Center_Chittagong_Broiler-2.jpg', NULL, NULL, 1, '2019-08-08 10:43:26', '2019-08-08 10:43:26'),
