(226, 333, 'SmartSoft_Feed', 'Cost Accounting Module', '<p>Dear Sir,</p><p>Good Afternoon</p><p>I face one problem that is accounting stock report R120 of Corn# September closing stock amount &amp; October opening Stock amount not matching. Actually in september Corn#3 transfer out when accounts close and generate then Corn#3 transfer amount show but when October stock generate Corn#3 opening balance not show. this problen show in Product type 05. Please see attached file of stock. Please solve this problem and help us.&nbsp;</p>', 'Closed', 'public/images/application/5da42e540f3292019-10-14-14-14-12RM_R120_September-193.pdf', 'public/images/application/5da42e540f4dd2019-10-14-14-14-12RM_01-13,Oct-19.pdf', NULL, NULL, 1, '2019-10-14 08:14:12', '2019-10-14 08:14:12'),
(227, 299, 'SmartSoft_Feed', 'Raw Material Inventory Management Module', '<p>Yesterday 13 oct at bogura fm we receive PP BAG &amp; receive in OP system. But today 14 oct we see at account stock not show this. Please check it. I attach GRN of this pp bag.</p>', 'Closed', 'public/images/application/5da42fe6c41092019-10-14-14-20-5461-43.pdf', NULL, NULL, NULL, 1, '2019-10-14 08:20:54', '2019-10-14 08:20:54'),
