(243, 306, 'SmartSoft_Feed', 'Finish goods Inventory Management Module', '<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:13.5pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;letter-spacing:.6pt\">Dear\r\nSir,<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:13.5pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;letter-spacing:.6pt\">From\r\nyesterday internet was disconnected. Now internet come &amp; we want to start\r\ntodayâ€™s activities. But after 2 pm Finish Goods win feed software date change\r\noption not come. Now we need to change date finish goods win feed software of\r\nBirganj Feed Mill.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:13.5pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;letter-spacing:.6pt\">&nbsp;<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><span style=\"font-size:13.5pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;letter-spacing:.6pt\">My\r\nwin feed ID is: - mohammed.zah<o:p></o:p></span></p>', 'Closed', NULL, NULL, NULL, NULL, 1, '2019-10-26 08:35:02', '2019-10-26 08:35:02'),
