(522, 253, 'SmartSoft_Feed', 'Raw Material Inventory Management Module', '<p>Dear Sir,</p><p>Good Morning.</p><p>I would like to inform that,our Bogura FM Raw Mat Dept (PC Name:BOGFM RM-4) one Keyboard &amp; mouse are not proper working,may be it was damaged. I already Send this Keyboard &amp; Mouse. So Pls Check it &amp; provide us for smoothly working.</p><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; margin: 0cm 0cm 0pt;\"><font face=\"comic sans ms,sans-serif\">B.rgds,</font></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; margin: 0cm 0cm 0pt;\">&nbsp;</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; margin: 0cm 0cm 0pt;\"><p style=\"font-family: &quot;comic sans ms&quot;, sans-serif; margin: 0cm