(523, 216, 'SmartSoft_Feed', 'NCR-CAR Online Module', '<p>Dear sir, Please note that my present work station Chuadanga FM &amp; my previous work station Dhaka FM. So when i am&nbsp; trying&nbsp; to summary all NCR 2020 (Chuadanga FM) i do not found chuadanga FM data in my ID but i can see Dhaka FM data.</p><p>Note: I can not export NCR data from winfeed to Excel sheet. Please support me to export data winfeed to Excel sheet to make report as management instruction.<br></p>', 'Closed', 'public/images/application/QxjOz.docx', NULL, NULL, NULL, 1, '2020-06-28 04:02:24', '2020-06-29 03:08:34'),
