(528, 306, 'SmartSoft_Feed', 'Finish goods Inventory Management Module', '<p><span style=\"letter-spacing: 0.8px;\">Dear Sir,</span></p><p class=\"MsoNormal\"><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">Today some feed bag packing due to yesterday production\r\nmachine problem &amp; this feed bag packing report show yesterday packing\r\nreport because month is closing. <b><span style=\"color:#0D0D0D;mso-themecolor:text1;mso-themetint:242;mso-style-textfill-fill-color:\r\n#0D0D0D;mso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:&quot;lumm=95000 lumo=5000&quot;\">But FG\r\ndept</span></b><span style=\"color:#0D0D0D;mso-themecolor:text1;mso-themetint:\r\n242;mso-style-textfill-fill-color:#0D0D0D;mso-style-textfill-fill-themecolor:\r\ntext1;mso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\n&quot;lumm=95000 lumo=5000&quot;\">. </span>of Birganj FM already change date. Now we need\r\nto open <span style=\"color:#0D0D0D;mso-themecolor:text1;mso-themetint:242;\r\nmso-style-textfill-fill-color:#0D0D0D;mso-style-textfill-fill-themecolor:text1;\r\nmso-style-textfill-fill-alpha:100.0%;mso-style-textfill-fill-colortransforms:\r\n&quot;lumm=95000 lumo=5000&quot;\">Yesterday date </span><span style=\"color:red\">(30.06.2020)\r\n</span>to input this packing report. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">So we request IT dept. to open yesterday date as early as\r\npossible.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\">Win Feed ID:- mohammed.zah<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">Computer Name:- BRGFMFG1<o:p></o:p></p>', 'Closed', NULL, NULL, NULL, NULL, 1, '2020-07-01 04:08:17', '2020-07-01 04:30:30'),
(529, 199, 'SmartSoft_Farm (Poultry)', 'Winfarm ', '<p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-indent:0in;text-align:left\"><span style=\"font-size:16.0pt;font-family:\r\nCalibri;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-theme-font:minor-fareast;mso-bidi-theme-font:minor-bidi;color:black;\r\nmso-color-index:1;language:en-US;mso-style-textfill-type:solid;mso-style-textfill-fill-themecolor:\r\ntext1;mso-style-textfill-fill-color:black;mso-style-textfill-fill-alpha:100.0%\">Medicine code-822000721. Actual balance will be=250 Ltr. but here shows 50 Ltr. used. So this\r\nDocument</span><span style=\"font-size:16.0pt;font-family:Calibri;mso-ascii-font-family:\r\nCalibri;mso-ascii-theme-font:minor-latin;mso-fareast-theme-font:minor-fareast;\r\nmso-bidi-theme-font:minor-bidi;color:black;mso-color-index:1;language:en-US;\r\nvertical-align:baseline;mso-text-raise:0%;mso-style-textfill-type:solid;\r\nmso-style-textfill-fill-themecolor:text1;mso-style-textfill-fill-color:black;\r\nmso-style-textfill-fill-alpha:100.0%\"> No-2006300101666608, need to Cancel this\r\ndocument, Org code 01016666, GL-001 Dhaka Breeder operation.Because actual we have no feeding in this month due to House was closed from last month. So please Cancel &amp; manage actual balance.<br></span></p>', 'Closed', 'public/images/application/vJVXq.xlsx', NULL, NULL, NULL, 1, '2020-07-01 13:31:27', '2020-07-05 03:22:30'),
