(538, 196, 'SmartSoft', 'Sales Module', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; letter-spacing: normal;\">Dear Sir,</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; letter-spacing: normal;\">For Your kind&nbsp;information that, we are continuing facing problems about&nbsp;<b>Mushak-6.3 Invoice amount</b>&nbsp;and&nbsp;<b>Winfeed Invoice amount</b>&nbsp;are not match. For Example we are giving a sample of two Invoice. Please see the&nbsp;attachment file.</div>', 'Closed', 'public/images/application/VSKqR.jpg', 'public/images/application/ztTJi.jpg', NULL, NULL, 1, '2020-07-08 09:31:18', '2020-08-06 14:01:17'),
