(540, 289, 'SmartSoft_Farm (Poultry)', 'Winfarm ', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; line-height: normal; font-family: Calibri,sans-serif; font-size: 11pt;\"><span style=\'font-family: \"Times New Roman\",serif; font-size: 12pt;\'>Dear Sir,</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; line-height: normal; font-family: Calibri,sans-serif; font-size: 11pt;\"><span style=\'font-family: \"Times New Roman\",serif; font-size: 12pt;\'>I would like to inform you that Rangpur Breeder Farm -02 has transferred to Broiler Farm, you have already known. But in the Holding Period Report some cost is continuing.</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; line-height: normal; font-family: Calibri,sans-serif; font-size: 11pt;\"><span style=\'font-family: \"Times New Roman\",serif; font-size: 12pt;\'>Now we need to remove this cost from this report.</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; line-height: normal; font-family: Calibri,sans-serif; font-size: 11pt;\"><span style=\'font-family: \"Times New Roman\",serif; font-size: 12pt;\'>&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 0pt; line-height: normal; font-family: Calibri,sans-serif; font-size: 11pt;\"><span style=\'font-family: \"Times New Roman\",serif; font-size: 12pt;\'>So, please take the necessary action to solve this problem.</span></p><div dir=\"ltr\" data-smartmail=\"gmail_signature\"><div dir=\"ltr\"><div dir=\"ltr\"><div><br></div><div>Please find the attached file(s)<br></div></div></div></div>', 'Closed', 'public/images/application/VHkSZ.pdf', NULL, NULL, NULL, 1, '2020-07-08 10:30:15', '2020-07-27 12:25:27'),
