(580, 225, 'SmartSoft_Feed', 'Finish goods Inventory Management Module', '<p><font size=\"3\"><font color=\"#000000\"><span>&nbsp;</span></font></font><font size=\"3\" color=\"#000000\">Dear Sir, I would like to inform you </font><font size=\"3\" color=\"#000000\">about resetting feed&nbsp;standard new age range of stock by location in win feed system for feed guarantee to customers according to&nbsp;our management decisions. So,&nbsp;I am requesting that you take necessary steps to reset the feed standard new age range immediately.</font></p>', 'Not Process', 'public/images/application/g9DH6.pdf', NULL, NULL, NULL, 1, '2020-08-10 10:01:40', '2020-08-10 10:01:40'),
