(583, 394, 'SmartSoft_Feed', 'Purchasing Indirect Module (Non QC )', 'Dear sir, we received one truck medicine on the date 04/08/2020. GRN no \r\n2010701263. hear we found supplier price value problem. medicine value \r\nis okay(1,784,000). But supplier value is double(3,568,000). It will be \r\n(1,784,000).<p><br></p>', 'Closed', NULL, NULL, NULL, NULL, 1, '2020-08-13 05:55:15', '2020-08-16 04:57:49'),
