(585, 351, 'SmartSoft_Feed', 'Finish goods Inventory Management Module', '<p>Dear Sir, Good Morning.</p><p>our Bogura FM Finish Goods winfeed system Maintain Good Issue Transaction ( 227-Issue Remix) Location option not Open that problem we not any Feed Remix issue. SO Pls take necessary step about this matter as soon as possible.</p><p>B.rgds</p><p>Md.Abdul Wahab.</p><p>Department manager.</p><p>Bogura Feed Mill.<br></p><p><br></p>', 'Closed', 'public/images/application/H2B0r.docx', NULL, NULL, NULL, 1, '2020-08-22 06:06:45', '2020-08-28 07:45:09'),
(586, 236, 'SmartSoft', 'Purchases Module', '<p>Following Products Should be received as \"GRN\", But received as \"GTN\", we make proper documents. But the weight need to deducted from Accounts Stock. Need to clear documents today.<br></p>', 'Closed', 'public/images/application/dlN0Y.jpg', 'public/images/application/H8HHL.jpg', 'public/images/application/K5xkU.jpg', 'public/images/application/SPHij.jpg', 1, '2020-08-22 08:01:47', '2020-08-25 07:22:44'),
