(589, 339, 'SmartSoft_Feed', 'Sales System Module', '<p>Dear Sir</p><p>It is attention to you that in winfeed software in chuadanga fm(Front sale dept.) when we give sale order for code Dairy\'18(40kg) in winfeed software that time seen everything ok but when we give print that time product name Dairy\'18(40kg) not show on issue slip, transfer slip &amp; summary report also. </p><p>So please take initiative steps for solve that problem. </p><p>My computer name:CDGFMSALE1.<br></p><p> <br></p>', 'Closed', 'public/images/application/DpB5Z.jpg', 'public/images/application/nxC8w.jpg', 'public/images/application/zkk6w.jpg', NULL, 1, '2020-08-25 04:00:31', '2020-08-26 15:01:08'),
(590, 245, 'SmartSoft_Food', 'Production system setup', '<p><span style=\"background-color: rgb(255, 255, 0);\">Need to cancel following dated documents from smart soft-food factory:</span></p><p>18, 20, 22, 23th august, 2020:</p><p>Please see the attachments for document number.</p>', 'Closed', 'public/images/application/FNYHH.pdf', NULL, NULL, NULL, 1, '2020-08-25 08:06:03', '2020-08-29 05:08:28'),
(591, 369, 'SmartSoft_Farm (Poultry)', 'Winfarm ', '<p>Dear Sir,</p><p>For your kind information that our north bengal broiler flock 07 close after that we try to take feeding efficiency report for matching yellow card but show error message, Please see the attachment.</p>', 'Closed', 'public/images/application/qEtSt.xlsx', NULL, NULL, NULL, 1, '2020-08-26 05:11:10', '2020-09-08 10:17:16'),
(592, 361, 'SmartSoft_Feed', 'Weight Module', '<p>We do not confirm data for data supplier Invalid. Please sir solve this problem immediately.<br></p>', 'Closed', 'public/images/application/bDNyw.xlsx', NULL, NULL, NULL, 1, '2020-08-26 08:43:58', '2020-08-26 12:10:35'),
(593, 238, 'SmartSoft_Feed', 'Accounting Stock Module', 'Dear Sir, Purchase Dept. mistakenly make GTN but need to make GRN. So that document deleted by IT. R120 report not showing this document but 391 report showing this. I attach that report. Please see that attachment &amp; take necessary steps. Thank you.<br><p><br></p>', 'Closed', 'public/images/application/SI9IR.jpg', 'public/images/application/B7xn4.jpg', NULL, NULL, 1, '2020-08-29 12:01:41', '2020-08-29 15:03:44'),
(594, 362, 'SmartSoft_Feed', 'Accounting Stock Module', '<p>1. Date 22th PP Bag Purchase not show in R120. </p><p>2. Generate Problem In win feed system (After 21 we generate Purchase system day by day then show Raw Materials, Medicine and Premix in Report R120 but few time leather not show in report R120. we generate many time but show same problem again)&nbsp;<span style=\"letter-spacing: 0.8px;\">&nbsp;</span></p>', 'Processing', NULL, NULL, 'public/images/application/B7OdS.pdf', 'public/images/application/5qlXb.pdf', 1, '2020-08-31 05:00:37', '2020-08-31 10:34:10'),
(595, 283, 'SmartSoft_Farm (Poultry)', 'Stock System', '<p style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\"><span style=\"font-size: 14pt; font-family: Calibri;\"><b>In August, the Holding Expense of\r\nValuka-6 House 3&nbsp;have to Clear or Zero. </b>Because in next flock house-3 will remain empty.</span></p><p style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; text-indent: 0in;\"><font face=\"Calibri\"><span style=\"font-size: 18.6667px;\"><span style=\"font-weight: bold; background-color: rgb(255, 255, 0);\">**It is very important&nbsp;for August Month Closing.</span> So, please solve this problem as early as possible.</span></font></p>', 'Closed', 'public/images/application/NUeiM.jpg', NULL, NULL, NULL, 1, '2020-08-31 09:23:39', '2020-09-09 06:30:39'),
(596, 419, 'SmartSoft_Farm (Poultry)', 'Winfarm ', '<p><font face=\"Times New Roman\" size=\"3\">\r\n\r\n</font></p><p style=\"margin: 0in 0in 10pt;\"><span style=\"line-height: 115%; font-size: 14pt;\"><font face=\"Calibri\">Dear Sir,\r\nWhen I log in my WIN farm Id this message show and I cannot enter to my Id.\r\nPlease take a look over this.</font></span></p><p><font face=\"Times New Roman\" size=\"3\">\r\n\r\n</font></p><p style=\"margin: 0in 0in 10pt;\"><span style=\"line-height: 115%; font-size: 14pt;\"><font face=\"Calibri\">My ID\r\nhasan.zam</font></span></p><p><font face=\"Times New Roman\" size=\"3\">\r\n\r\n</font><br></p>', 'Closed', 'public/images/application/XgFKp.jpg', NULL, NULL, NULL, 1, '2020-08-31 10:20:39', '2020-09-01 03:56:40'),
(597, 225, 'SmartSoft_Feed', 'Finish goods Inventory Management Module', '<p>Dear Sir, on date 31/08/2020 Bhai Bhai enterprise M/S customer sales data not recorded in account stock 391. I have already attachment that customer Issue slip, sales summary and Account stock 391 report. Please check and take action as soon as possible.<br></p>', 'Not Process', 'public/images/application/Y5SJS.jpg', 'public/images/application/clcmd.jpg', 'public/images/application/Tt3I8.pdf', 'public/images/application/gVbzA.pdf', 1, '2020-09-01 10:13:19', '2020-09-01 10:13:19'),
